import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/Header'
import { Route } from 'react-router-dom';
import Home from './components/Home'

function App() {
  return (
    <div className="App">
      <Header />
      <Route exact={true} path="/" component={Home} />



    </div>
  );
}

export default App;
